package event

actual class StackTraceEventIdentifierStrategy<X : Any> {
    actual fun generateIdentifier(subject: Event<X>): String {
        try {
            throw Exception()
        } catch (e: Exception){
            val addresses = e.getStackTraceAddresses().joinToString("")
            //val stackTrace = e.getStackTrace().toString()
            //val stackTrace = e.stackTraceToString()
            
            
            println(addresses)
            return addresses
        }
    }
}